    imagery, Assateague Island to Metompkin Island, Maryland and Virginia, 1984 to 2014",nt"tracking_summary":
    {ntt"total": 11,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-03-16T06:31:25.771967",nt"name": "landsat-satellite-imagery-assateague-island-to-metompkin-island-maryland-and-virginia-1984-2014",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Geological Survey has a long history
    of responding to and documenting the impacts of storms along the Nationu00e2u0080u0099s
    coasts and incorporating these data into storm impact and coastal change vulnerability
    assessments. These studies, however, have traditionally focused on sandy shorelines
    and sandy barrier-island systems, without consideration of impacts to coastal wetlands.
    The goal of the Barrier Island and Estuarine Wetland Physical Change Assessment
    project is to integrate a wetland-change assessment with existing coastal-change
    assessments for the adjacent sandy dunes and beaches, initially focusing on Assateague
    Island along the Maryland and Virginia coastline. Assateague Island was impacted
    by waves and storm surge associated with the passage of Hurricane Sandy in October
    2012, including erosion and overwash along the ocean-facing sandy shoreline as well
    as erosion and overwash deposition in the back-barrier and estuarine bay environments.
    This report serves as an archive of data that were derived from Landsat 5 and Landsat
    8 imagery from 1984 to 2014, including wetland and terrestrial habitat extents;
    open-ocean, back-barrier, and estuarine mainland shoreline positions; and sand-line
    positions along the estuarine mainland and barrier shorelines from Assateague Island,
    Maryland to Metompkin Island, Virginia. The geographic information system data files
    with accompanying formal Federal Geographic Data Committee (FGDC) metadata can be
    downloaded from http://pubs.usgs.gov/ds/0968/ds968_data.html.",nt"license_title":
